import React from "react";

const App: React.FC = () => {
  return (
    <div className="flex justify-center h-screen bg-gray-100">
      <h2 className="text-2xl text-center font-bold py-8 leading-7 text-gray-900 sm:truncate sm:text-3xl sm:tracking-tight">
        Welcome to Agnos Health Check
      </h2>
      <div>
        <img className="inline" src="/.png" alt="Logo"></img>
      </div>
    </div>
  );
};

export default App;
